from typing import List, Dict

class Solution:
    def sum_dict(self, dict: Dict[int, int]):
        s = 0
        for _, num in dict.items():
            s += num
        return s

    def solve(self, nums: List[int]) -> int:
        n = len(nums)
        if n <= 2:
            return 0
        dict = {}
        for i in range(n):
            dict[nums[i]] = dict.get(nums[i], 0) + 1

        res = {}
        for key, value in dict.items():
            sub = dict.copy()
            sub[key] = 0
            sum = self.sum_dict(sub)
            if sum == value:
                res[key] = value
        if res:
            return len(res)
        else:
            return 0

