class Stack:
    def __init__(self, maxsize=None):
        self.maxsize = maxsize
        self.items = deque()
    def push(self, x):
        if not self.maxsize or self.size() < self.maxsize:
            self.items.append(x)
        else:
            raise ValueError
    def pop(self):
        if self.items:
            return self.items.pop()
        else:
            raise ValueError
    def size(self):
        return len(self.items)
    def is_empty(self):
        return not self.items
    def peek(self):
        if self.items:
            return self.items[-1]
        raise ValueError
    def __repr__(self):
        return "Stack({!r})".format(list(self.items))
    def __str__(self):
        return "Stack({})".format(list(self.items))
    def __len__(self):
        return self.size()

