from collections import defaultdict
from typing import List, Tuple, DefaultDict, Dict

class Solution:
    def __init__(self, s: str):
        self.s = s
        self.res = defaultdict(int)
        self.cache = {}
        self.populate_cache()
        self.max_length = 0

    def populate_cache(self) -> None:
        for i, c in enumerate(self.s):
            self.cache[c] = i

    def get_max_length(self) -> int:
        max_length = 0
        for key in self.cache:
            if self.cache[key] > max_length:
                max_length = self.cache[key]
        self.max_length = max_length
        return max_length

    def is_valid_position(self, pos: int) -> bool:
        return 0 <= pos < self.max_length

    def is_valid_length(self, l: int, r: int) -> bool:
        return 1 <= l <= r <= self.max_length

    def replace(self, pos: int, c: str) -> None:
        if self.is_valid_position(pos):
            # print("replace", pos, c)
            self.s = self.s[:pos] + c + self.s[pos + 1:]
            self.res[c] = 1
            return

    def count_distinct(self, l: int, r: int) -> int:
        # print("count", l, r)
        res = 0
        for key in self.cache:
            if self.is_valid_length(l, r) and self.cache[key] >= l and self.cache[key] <= r:
                res += 1
        return res

