        if layer in self.layers:
            if self.layers[layer] < self.length:
                self.layers[layer] += roll
            else:
                self.layers[layer] = roll
        else:
            self.layers[layer] = roll

    def layers_left(self) -> Dict[int, int]:
        layers = {}
        for layer in self.layers:
            layers[layer] = self.length - self.layers[layer]
        return layers

    def get_layers_left(self) -> Dict[int, int]:
        return self.layers_left()

