from typing import List
from collections import defaultdict

class Solution:
    def spread(self, grid, N, M):
        # init vars
        self.stone = "#"
        self.air = "."
        self.water = "V"

        # vars for lookup
        self.dict = defaultdict(list)
        self.dict[self.air] = [(i, j) for i in range(N) for j in range(M)]

        # loop for each second
        for second in range(1, 21):
            # vars for new grid
            new_grid = []
            for i in range(N):
                new_grid.append([])
                for j in range(M):
                    if grid[i][j] == self.water:
                        if (i, j) == (0, 0) or (i, j) == (0, M-1) or (i, j) == (N-1, 0) or (i, j) == (N-1, M-1):
                            new_grid[i].append(self.water)
                        else:
                            water_neighbors = self.get_water_neighbors(grid, i, j, N, M)
                            if water_neighbors and water_neighbors[0] == self.air:
                                new_grid[i].append(self.water)
                            elif water_neighbors and water_neighbors[0] == self.stone:
                                water_neighbors.pop(0)
                                for neighbor in water_neighbors:
                                    new_grid[neighbor[0]][neighbor[1]] = self.air
                                new_grid[i].append(self.water)
                            else:
                                new_grid[i].append(self.water)
                    elif grid[i][j] == self.air:
                        water_neighbors = self.get_water_neighbors(grid, i, j, N, M)
                        if water_neighbors:
                            if water_neighbors[0] == self.water:
                                new_grid[i].append(self.air)
                            elif water_neighbors[0] == self.stone:
                                water_neighbors.pop(0)
                                for neighbor in water_neighbors:
                                    new_grid[neighbor[0]][neighbor[1]] = self.air
                                new_grid[i].append(self.air)
                            else:
                                new_grid[i].append(self.air)
                        else:
                            new_grid[i].append(self.air)
                    else:
                        new_grid[i].append(grid[i][j])
            grid = new_grid
        return new_grid

    def get_water_neighbors(self, grid, i, j, N, M):
        neighbors = []
        for neighbor in self.dict[grid[i][j]]:
            if 0 <= neighbor[0] < N and 0 <= neighbor[1] < M:
                neighbors.append(neighbor)
        return neighbors

    def print_grid(self, grid):
        for i in range(len(grid)):
            print("".join(grid[i]))

    def solution(self, stdin: str) -> str:
        # init vars
        grid = stdin.split("\n")
        N, M = [int(i) for i in stdin.split("\n")[0].split(" ")]
        grid = [list(i) for i in grid]

        # solve problem
        new_grid = self.spread(grid, N, M)

        # print solution
        self.print_grid(new_grid)

