from collections import deque
from typing import List

class Solution:
    def minCnt(self, A: List[int], B: List[int], diff: int) -> int:
        if diff == 0:
            return 1

        q = deque()
        q.append(0)

        visited = [False] * len(A)

        while q:
            curr = q.popleft()
            visited[curr] = True

            for i in range(curr + 1, len(A)):
                if A[curr] - B[i] <= diff and not visited[i]:
                    q.append(i)

        return len([i for i in visited if visited[i]])

